pdfjsframe.addEventListener("load", function(){
  loadPdfIntoIframe(base64);
});

function loadPdfIntoIframe(base64Data) {
    const pdfData = base64ToUint8Array(base64Data);

    const interval = setInterval(() => {
      const viewerWindow = pdfjsframe.contentWindow;
      const app = viewerWindow?.PDFViewerApplication;

      if (app && app.initialized) {
        clearInterval(interval);
        app.open({ data: pdfData }); // âœ… Use { data: ... }
      }
    }, 100);
  }
  
  function base64ToUint8Array(base64) {
    const raw = atob(base64);
    const uint8Array = new Uint8Array(raw.length);
    for (let i = 0; i < raw.length; i++) {
      uint8Array[i] = raw.charCodeAt(i);
    }
    return uint8Array;
  }
